                    </div>

                    <div className="logBox">
                        <span>First Name</span>
                        <input placeholder="Your firstname"></input>
                    </div>

                    <div className="logBox">
                        <span>Last Name</span>
                        <input placeholder="Your lastname"></input>
                    </div>

